import {useState} from "react";

function AddExercise( {handlePost, exercises} ) {

    // const [bodyPart, setBodyPart] = useState("")
    // const [equipment, setEquipment] = useState("")
    // const [gif, setGif] = useState("")
    // const [name, setName] = useState("")
    // const [target, setTarget] = useState("")

    const [newExerciseInput, setNewExerciseInput] = useState({
        bodyPart: '',
        equipment: '',
        gifUrl: '',
        name: '',
        target: ''
    })







    return (
        <div className="new-exercise-form">
            <h2>New Exercise</h2>
            <form onSubmit={e => {
                e.preventDefault();
                handlePost(newExerciseInput)
            }}>
                <input onChange={(e)=> setNewExerciseInput({ ...newExerciseInput, bodyPart:e.target.value})} type="text" name="name" placeholder="Body Part" value={newExerciseInput.name}/>
                <input onChange={(e)=> setNewExerciseInput({ ...newExerciseInput, equipment:e.target.value})} type="text" name="name" placeholder="a" value={newExerciseInput.name}></input>
                <input onChange={(e)=> setNewExerciseInput({ ...newExerciseInput, gifUrl:e.target.value})} type="text" name="name" placeholder="a" value={newExerciseInput.name}></input>
                <input onChange={(e)=> setNewExerciseInput({ ...newExerciseInput, name:e.target.value})} type="text" name="name" placeholder="a" value=""></input>
                <input onChange={(e)=> setNewExerciseInput({ ...newExerciseInput, target:e.target.value})} type="text" name="name" placeholder="a" value=""></input>
                <button type="submit"> Submit Exercise </button>
            </form>
        </div>
    )
}




export default AddExercise;
